import React from "react";
import styled from "styled-components";
import CommonTask from "../feature/task/component/commontask/CommonTask";
// import EditTasks from "../feature/task/component/EditTask/EditTask";
import Header from "./header/header";
import Sidebar from "./sidebar/Sidebar";
// import Content from './content/conten'

const MainContent = styled.div`
  display: flex;
`;
const Layout = () => {
  return (
    <div>
      <Header></Header>
      <MainContent>
        <Sidebar />
        {/* <EditTasks /> */}
        <CommonTask />
      </MainContent>
    </div>
  );
};

export default Layout;
